import React, {Component} from 'react';
import {Navbar, Nav} from 'react-bootstrap';
import logo from './assets/anshor.space.png';

class Header extends Component{
  render(){
    return(
      <Navbar className="justify-content-between bg-bluegradient" variant="dark">
        <Navbar.Brand>
          <img
            src={logo}
            height="30"
            alt="anshor.space logo"
            />
        </Navbar.Brand>
        <Nav className="float-right white-text">
          <Nav.Link className="float-right" href="#">ABOUT</Nav.Link>
          <Nav.Link className="float-right" href="#">SKILL</Nav.Link>
          <Nav.Link className="float-right white-text" href="#">PROJECT</Nav.Link>
          <Nav.Link className="float-right" href="#">CONTACT</Nav.Link>
        </Nav>
      </Navbar>
    );
  }
}

export default Header;
